tables.table_schema:
CREATE TABLE maintenance_log (
  id INT PRIMARY KEY,
  system_id INT,
  maintenance_type VARCHAR(50),
  maintenance_date DATE
);

CREATE TABLE service_log (
  id INT PRIMARY KEY,
  system_id INT,
  service_type VARCHAR(50),
  service_date DATE
);

CREATE TABLE hardware_system (
  id INT PRIMARY KEY,
  name VARCHAR(100),
  manufacturer VARCHAR(100),
  purchase_date DATE
);

CREATE TABLE maintenance_team (
  id INT PRIMARY KEY,
  team_name VARCHAR(100),
  team_lead VARCHAR(100),
  team_size INT
);

CREATE TABLE maintenance_history (
    maintenance_id INT PRIMARY KEY,
    hardware_id INT,
    maintenance_description TEXT,
    maintenance_date TIMESTAMP
);

CREATE TABLE service_history (
    service_id INT PRIMARY KEY,
    hardware_id INT,
    service_description TEXT,
    service_date TIMESTAMP
);

CREATE TABLE hardware_systems (
    hardware_id INT PRIMARY KEY,
    hardware_name TEXT,
    manufacturer TEXT,
    model TEXT
);

CREATE TABLE technicians (
    technician_id INT PRIMARY KEY,
    technician_name TEXT,
    technician_specialization TEXT
);

CREATE TABLE maintenance_technicians (
    maintenance_id INT,
    technician_id INT,
    PRIMARY KEY (maintenance_id, technician_id)
);
